import{_ as s,o,c as a,R as e}from"./chunks/framework.318fa179.js";const A=JSON.parse('{"title":"PostgreSQL mod() 函数","description":"","frontmatter":{},"headers":[],"relativePath":"database/postgreSQL/ref/mod.md","filePath":"database/postgreSQL/ref/mod.md","lastUpdated":1690010418000}'),l={name:"database/postgreSQL/ref/mod.md"},n=e('<h1 id="postgresql-mod-函数" tabindex="-1">PostgreSQL mod() 函数 <a class="header-anchor" href="#postgresql-mod-函数" aria-label="Permalink to &quot;PostgreSQL mod() 函数&quot;">​</a></h1><p>PostgreSQL <code>mod()</code> 函数返回指定的两个数字做除法运算后的余数。</p><h2 id="mod-语法" tabindex="-1"><code>mod()</code> 语法 <a class="header-anchor" href="#mod-语法" aria-label="Permalink to &quot;`mod()` 语法&quot;">​</a></h2><p>这里是 PostgreSQL <code>mod()</code> 函数的语法：</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">mod(y, x) </span><span style="color:#89DDFF;">-&gt;</span><span style="color:#A6ACCD;"> numeric_type</span></span></code></pre></div><h3 id="参数" tabindex="-1">参数 <a class="header-anchor" href="#参数" aria-label="Permalink to &quot;参数&quot;">​</a></h3><ul><li><p><em><code>y</code></em></p><p>必需的。 被除数。它可以是 <code>smallint</code>, <code>integer</code>, <code>bigint</code>, 和 <code>numeric</code> 类型的数据。</p></li><li><p><em><code>x</code></em></p><p>必需的。 除数。它可以是 <code>smallint</code>, <code>integer</code>, <code>bigint</code>, 和 <code>numeric</code> 类型的数据。</p></li></ul><h3 id="返回值" tabindex="-1">返回值 <a class="header-anchor" href="#返回值" aria-label="Permalink to &quot;返回值&quot;">​</a></h3><p>PostgreSQL <code>mod()</code> 函数返回 <code>y</code> 除以 <code>x</code> 的余数，即 <code>y/x</code> 的余数。</p><p>如果参数为 <code>NULL</code>，<code>mod()</code> 函数将返回 <code>NULL</code>。</p><p>如果您提供了一个不是数字类型的参数，PostgreSQL 将给出一个错误。</p><h2 id="mod-示例" tabindex="-1"><code>mod()</code> 示例 <a class="header-anchor" href="#mod-示例" aria-label="Permalink to &quot;`mod()` 示例&quot;">​</a></h2><p>这里有几个 <code>mod()</code> 函数的示例。</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#F78C6C;">SELECT</span></span>\n<span class="line"><span style="color:#A6ACCD;">    mod(</span><span style="color:#F78C6C;">3</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">) </span><span style="color:#F78C6C;">AS</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">mod(3, 2)</span><span style="color:#89DDFF;">&quot;</span><span style="color:#A6ACCD;">,</span></span>\n<span class="line"><span style="color:#A6ACCD;">    mod(</span><span style="color:#F78C6C;">3</span><span style="color:#A6ACCD;">.</span><span style="color:#F78C6C;">3</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;">.</span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">) </span><span style="color:#F78C6C;">AS</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">mod(3.3, 1.2)</span><span style="color:#89DDFF;">&quot;</span><span style="color:#A6ACCD;">;</span></span></code></pre></div><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">mod(</span><span style="color:#F78C6C;">3</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">) | mod(</span><span style="color:#F78C6C;">3</span><span style="color:#A6ACCD;">.</span><span style="color:#F78C6C;">3</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;">.</span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">)</span></span>\n<span class="line"><span style="color:#676E95;font-style:italic;">-----------+---------------</span></span>\n<span class="line"><span style="color:#A6ACCD;">         </span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;"> |           </span><span style="color:#F78C6C;">0</span><span style="color:#A6ACCD;">.</span><span style="color:#F78C6C;">9</span></span></code></pre></div><p>这里，</p><ul><li><code>3 / 2 = 1 ... 1</code>，因此 <code>mod(3, 2)</code> 返回了 <code>1</code>。</li><li><code>3.3 / 1.2 = 2 ... 0.9</code>，因此 <code>mod(3.3, 1.2)</code> 返回了 <code>0.9</code>。</li></ul>',17),p=[n];function c(t,d,r,C,i,y){return o(),a("div",null,p)}const h=s(l,[["render",c]]);export{A as __pageData,h as default};
